    public static double[][] getGrid(int  num)    
    {
        int n = patrones.length/5;
        int pos = num* n;
        double res[][] = new double[(n+4)][448];
        for(int i = 0  ; i<n; i++)
        {
            res[i] = patrones[pos];
            pos++;
        }
        pos = n;
        for(int i = 0 ; i< n; i++)
        {            
            if(i!=num)
            {
                res[pos ] = patrones[num* i];
                pos++;
            }
        }
    	return res;
    }
